import React from 'react';
import './AnimeCatalog.css'; // Se você tiver um CSS específico

const AnimeCatalog = () => {
  return (
    <div className="anime-catalog">
      <h1>Catálogo de Animes</h1>
      <div className="anime-list">
        {/* Aqui você pode adicionar seus cards de animes */}
        {/* Exemplo de card de anime */}
        <div className="anime-card">
          <img src="url-da-imagem-do-anime" alt="Anime" />
          <h2>Título do Anime</h2>
          <p>Sinopse do anime...</p>
          <p>Número de Episódios: X</p>
        </div>
        {/* Repita o card para os outros animes */}
      </div>
    </div>
  );
};

export default AnimeCatalog;
